import React from 'react';

function MapSelector() {
  return (
    <div style={{ margin: '20px' }}>
      <h2 style={{ color: '#fff', marginBottom: '15px', fontFamily: "'Poppins', sans-serif", fontWeight: '700', fontSize: '20px' }}>Choose From Map</h2>
      <div style={{
        width: '388px',
        height: '180px',
        borderRadius: '25px',
        overflow: 'hidden',
        boxShadow: '0 6px 16px rgba(0,0,0,0.8)',
        cursor: 'pointer',
        marginLeft: 'auto',
        marginRight: 'auto'
      }}>
        <img
          src="https://maps.googleapis.com/maps/api/staticmap?center=Victoria+Memorial,India&zoom=14&size=600x300&maptype=roadmap&key=YOUR_API_KEY"
          alt="Map"
          style={{ width: '100%', height: '100%', objectFit: 'cover' }}
        />
      </div>
    </div>
  );
}

export default MapSelector;
